import React from 'react';

const InternshipsSection = () => {
  const internships = {
    available: [
      {
        title: 'Software Development Intern',
        company: 'Google',
        duration: '3 months',
        stipend: '$5,000/month',
        location: 'Remote',
        description: 'Work on cutting-edge projects with experienced mentors'
      },
      {
        title: 'UI/UX Design Intern',
        company: 'Meta',
        duration: '4 months',
        stipend: '$4,500/month',
        location: 'Menlo Park, CA',
        description: 'Design user experiences for millions of users worldwide'
      },
      {
        title: 'Data Science Intern',
        company: 'Amazon',
        duration: '6 months',
        stipend: '$6,000/month',
        location: 'Seattle, WA',
        description: 'Analyze large datasets and build machine learning models'
      }
    ],
    recommended: [
      {
        title: 'Frontend Development Intern',
        company: 'Netflix',
        duration: '3 months',
        stipend: '$5,500/month',
        location: 'Los Gatos, CA',
        description: 'Build responsive user interfaces for streaming platform'
      },
      {
        title: 'Backend Development Intern',
        company: 'Spotify',
        duration: '4 months',
        stipend: '$5,000/month',
        location: 'Remote',
        description: 'Develop scalable backend services for music streaming'
      },
      {
        title: 'AI Research Intern',
        company: 'OpenAI',
        duration: '6 months',
        stipend: '$7,000/month',
        location: 'San Francisco, CA',
        description: 'Contribute to groundbreaking AI research projects'
      }
    ]
  };

  const InternshipCard = ({ internship, index }) => (
    <div 
      className="card holographic"
      style={{ animationDelay: `${index * 0.1}s` }}
    >
      <div style={{
        display: 'flex',
        alignItems: 'center',
        marginBottom: '1rem'
      }}>
        <div style={{
          width: '50px',
          height: '50px',
          background: 'linear-gradient(45deg, #00FFFF, #00BFFF)',
          borderRadius: '10px',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          marginRight: '1rem',
          fontWeight: '600',
          fontSize: '1.2rem',
          color: 'white'
        }}>
          {internship.company.charAt(0)}
        </div>
        <div>
          <h4 style={{ color: 'white', marginBottom: '0.25rem' }}>{internship.title}</h4>
          <p style={{ color: '#00FFFF', fontSize: '1rem', fontWeight: '600' }}>
            {internship.company}
          </p>
        </div>
      </div>
      
      <div style={{ 
        display: 'grid',
        gridTemplateColumns: '1fr 1fr',
        gap: '0.5rem',
        marginBottom: '1rem'
      }}>
        <div style={{ color: '#00BFFF', fontSize: '0.9rem' }}>
          <strong>Duration:</strong> {internship.duration}
        </div>
        <div style={{ color: '#00BFFF', fontSize: '0.9rem' }}>
          <strong>Stipend:</strong> {internship.stipend}
        </div>
        <div style={{ color: '#00BFFF', fontSize: '0.9rem' }}>
          <strong>Location:</strong> {internship.location}
        </div>
      </div>
      
      <p style={{ 
        color: 'rgba(255, 255, 255, 0.8)',
        fontSize: '0.9rem',
        marginBottom: '1.5rem',
        lineHeight: '1.4'
      }}>
        {internship.description}
      </p>
      
      <button className="btn-primary" style={{ width: '100%' }}>
        Apply Now
      </button>
    </div>
  );

  return (
    <section className="section">
      <div className="container">
        <h2 className="section-title fade-in-up">
          Internship Opportunities
        </h2>
        
        <div style={{ marginBottom: '4rem' }}>
          <h3 style={{
            fontSize: '2rem',
            color: '#00FFFF',
            marginBottom: '2rem',
            textAlign: 'center'
          }}>
            Available Internships
          </h3>
          <div className="grid grid-cols-3">
            {internships.available.map((internship, index) => (
              <InternshipCard key={internship.title} internship={internship} index={index} />
            ))}
          </div>
        </div>
        
        <div>
          <h3 style={{
            fontSize: '2rem',
            color: '#00FFFF',
            marginBottom: '2rem',
            textAlign: 'center'
          }}>
            Recommended Internships
          </h3>
          <div className="grid grid-cols-3">
            {internships.recommended.map((internship, index) => (
              <InternshipCard key={internship.title} internship={internship} index={index} />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default InternshipsSection;
